import React from 'react'
import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, link, Link} from 'react-router-dom'



function App() {
  return (
    <div className="App">
      <Link to="client-list">
     <button>Client List</button>
     </Link>
     <Link to="/add-client">
     <button>Add Client</button>
     </Link>
    </div>
  );
}

export default App;
